/* List 产品管理/产品列表 */

// ==================
// 所需的各种插件
// ==================

import React from 'react';
import { connect } from 'react-redux';
import { bindActionCreators } from 'redux';
import P from 'prop-types';
import Config from '../../../../config/config';
import { Form, Button, Icon, Input, Checkbox, Row , Table, message, Popconfirm, Popover, Modal, Radio, Tooltip, Select, Upload, Divider } from 'antd';
import './index.scss';
import tools from '../../../../util/tools'; // 工具
import Power from '../../../../util/power'; // 权限
import { power } from '../../../../util/data';
import _ from 'lodash';
// ==================
// 所需的所有组件
// ==================


// ==================
// 本页面所需action
// ==================

import { findProductByWhere, findProductTypeByWhere, addProduct, updateProduct, updateProductType,deleteProduct,removeProduct, deleteImage, findProductModelByWhere ,upProductModel , onChange3} from '../../../../a_action/shop-action';

// ==================
// Definition
// ==================
const FormItem = Form.Item;
const RadioGroup = Radio.Group;
const Option = Select.Option;
class Category extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            data: [], // 当前页面全部数据
            productTypes: [],   // 所有的产品类型
            productModels: [],  // 所有的产品型号
            productprice:'',  //产品的价格
            searchTypeId: undefined, // 搜索 - 类型名
            searchName: '', // 搜索 - 名称
            addOrUp: 'add',     // 当前操作是新增还是修改
            addnewModalShow: false, // 添加新用户 或 修改用户 模态框是否显示
            addnewLoading: false, // 是否正在添加新用户中
            upModalShow: false, // 修改模态框是否显示
            upLoading: false, // 是否正在添加新用户中
            nowData: null, // 当前选中用户的信息，用于查看详情、修改、分配菜单
            queryModalShow: false, // 查看详情模态框是否显示
            pageNum: 1, // 当前第几页
            pageSize: 10, // 每页多少条
            total: 0, // 数据库总共多少条数据
            code: undefined,  //产品类型所对应的code值
            fileList: [],   // 产品图片已上传的列表
            fileListDetail: [], // 详细图片已上传的列表
            fileLoading: false, // 产品图片正在上传
            fileDetailLoading: false,   // 详细图片正在上传
        };
    }

    componentDidMount() {
        this.getAllProductType();   // 获取所有的产品类型
        this.getAllProductModel();  // 获取所有的产品型号
        this.onGetData(this.state.pageNum, this.state.pageSize);
    }

    // 查询当前页面所需列表数据
    onGetData(pageNum, pageSize) {
        const params = {
            pageNum,
            pageSize,
            onShelf: this.state.searchName,
            productType: this.state.searchTypeId,
        };
        this.props.actions.findProductByWhere(tools.clearNull(params)).then((res) => {
            if(res.returnCode === "0") {
                this.setState({
                    data: res.messsageBody.result || [],
                    pageNum,
                    pageSize,
                    total :res.messsageBody.total,
                });
            } else {
                message.error(res.returnMessaage || '获取数据失败，请重试');
            }
        });
    }

    // 获取所有的产品类型，当前页要用
    getAllProductType() {
        this.props.actions.findProductTypeByWhere({ pageNum: 0, pageSize: 9999 }).then((res) => {
            if(res.returnCode === '0') {
                this.setState({
                    productTypes: res.messsageBody.result,
                });
            }
        });
    }

    // 获取所有产品型号，当前页要用
    getAllProductModel() {
        this.props.actions.findProductModelByWhere({ pageNum:0, pageSize: 9999 }).then((res) => {
            if(res.returnCode === '0') {
                this.setState({
                    productModels: res.messsageBody.modelList.result,
                });
            }
        });
    }
    // 工具 - 根据产品类型ID查产品类型名称
    findProductNameById(id) {
        const t = this.state.productTypes.find((item) => String(item.id) === String(id));
        return t ? t.name : '';
    }

    // 工具 - 根据产品型号ID获取产品型号名称
    getNameByModelId(id) {
        const t = this.state.productModels.find((item) => String(item.id) === String(id));
        return t ? t.name : '';
    }

    //工具 - 根据产品型号ID获取产品型号价格
    getNameByModePrice(id) {
        const t = this.state.productPrice.find((item) => String(item.id) === String(id));
        return t ? t.name : '';
   }

    // 工具 - 根据有效期type获取有效期名称
    getNameForInDate(time, type) {
        switch(String(type)){
            case '0': return '长期有效';
            case '1': return `${time}天`;
            case '2': return `${time}月`;
            case '3': return `${time}年`;
            default: return '';
        }
    }

    //工具 - 根据活动类型id获取活动名称
    getActivity(id){
        switch(String(id)){
            case '1' : return '普通产品';
            case '2' : return '活动产品';
            default: return '';
        }

    }


    // 搜索 - 产品类型输入框值改变时触发
    onSearchTypeId(typeId) {
        this.setState({
            searchTypeId: typeId,
        });
    }

    //搜索 - 产品状态输入框值改变时触发
    searchNameChange(e) {
        this.setState({
            searchName: e,
        });
    }


    // 修改某一条数据 模态框出现
    onUpdateClick(record) {
        const me = this;
        const { form } = me.props;
        console.log('是什么：', record);
        form.setFieldsValue({
            addnewName: record.name,
            addnewTypeId: `${record.typeId}`,
            addnewTypeCode: String(record.typeCode),
            addnewOnShelf: record.onShelf ? '1' : '0',
            addnewProductImg:record.productImg,
            addnewDetailImg:record.detailImg,
            addnewTimeLimitNum: record.timeLimitNum,
            addnewTimeLimitType: record.timeLimitType,
            addnewActivityType: record.activityType,
        });
        console.log('是什么：', record);
        me.setState({
            nowData: record,
            upModalShow: true,
            code: record.typeId,
            fileList: record.productImg ? record.productImg.split(',').map((item, index) => ({ uid: index, url: item, status: 'done' })) : [],   // 产品图片已上传的列表
            // fileListDetail: record.detailImg ? [{uid: -1, url: record.detailImg, status: 'done'}] : [], // 详细图片已上传的列表
            fileListDetail:record.detailImg ? record.detailImg.split(',').map((item, index) => ({ uid: index, url: item, status: 'done' })) : [],
        });
    }

    // 确定修改某一条数据
    onUpOk() {
        const me = this;
        const { form } = me.props;
        form.validateFields([
            'addnewName',
            'addnewTypeId',
            'addnewTypeCode',
            'addnewOnShelf',
            'addnewProductImg',
            'addnewDetailImg',
            'addnewTimeLimitNum',
            'addnewTimeLimitType',
            'addnewActivityType'
        ], (err, values) => {
            if(err) { return; }

            me.setState({
                upLoading: true,
            });
            const params = {
                id: me.state.nowData.id,
                name: values.addnewName,
                typeId: values.addnewTypeId,
                typeCode:values.addnewTypeCode,
                onShelf: values.addnewOnShelf,
                timeLimitNum: values.addnewTimeLimitNum,
                timeLimitType: values.addnewTimeLimitType,
                activityType: values.addnewActivityType,
                productImg: this.state.fileList.map((item) => item.url).join(','),
                detailImg: this.state.fileListDetail.map((item) => item.url).join(','),
                // detailImg: this.state.fileListDetail.length ? this.state.fileListDetail[0].url : '',
            };

            this.props.actions.updateProduct(params).then((res) => {
                if (res.returnCode === "0") {
                    message.success("修改成功");
                    this.onGetData(this.state.pageNum, this.state.pageSize);
                    this.onUpClose();
                } else {
                    message.error(res.returnMessaage || '修改失败，请重试');
                }
                me.setState({
                    upLoading: false,
                });
            }).catch(() => {
                me.setState({
                    upLoading: false,
                });
            });
        });
    }

    // 关闭修改某一条数据
    onUpClose() {
        this.setState({
            upModalShow: false,
        });
    }

    // 删除某一条数据
    onRemoveClick(id) {
        this.props.actions.removeProduct({id: id}).then((res) => {
            if(res.returnCode === "0") {
                message.success('删除成功');
                this.onGetData(this.state.pageNum, this.state.pageSize);
            } else {
                message.error(res.returnMessaage || '删除失败，请重试');
            }
        });
    }


    // 搜索
    onSearch() {
        this.onGetData(this.state.pageNum, this.state.pageSize);
    }

    // 查询某一条数据的详情
    onQueryClick(record) {
        this.setState({
            nowData: record,
            code: record.typeId,
            queryModalShow: true,
        });
    }

    // 查看详情模态框关闭
    onQueryModalClose() {
        this.setState({
            queryModalShow: false,
        });
    }

    // 添加新用户模态框出现
    onAddNewShow() {
        const me = this;
        const { form } = me.props;
        form.resetFields([
            'addnewName',
            'addnewTypeId',
            'addnewTypeCode',
            'addnewOnShelf',
            'addnewProductImg',
            'addnewDetailImg',
            'addnewTimeLimitType',
            'addnewTimeLimitNum',
            'addnewActivityType'
        ]);
        this.setState({
            addOrUp: 'add',
            fileList: [],
            fileListDetail: [],
            addnewModalShow: true,
            nowData:null,
            code: undefined,
        });
    }

    // 下架或上架
    onUpdateClick2(record) {
        const params = {
            id:record.id,
            name: record.name,
            price: record.price,
            typeId: Number(record.typeId),
            typeCode: record.typeCode,
            saleMode: Number(record.saleMode),
            marketPrice: record.marketPrice,
            onShelf: record.onShelf ? 1 : 0,
            productImg:record.productImg,
            detailImg: record.detailImg,
            activityType:record.activityType,
        };

        this.props.actions.deleteProduct(params).then((res) => {
            if (res.returnCode === "0") {
                message.success("修改成功");
                this.onGetData(this.state.pageNum, this.state.pageSize);
            } else {
                message.error(res.returnMessaage || '修改失败，请重试');
            }
        }).catch(() => {
            message.error('修改失败');
        });
    }

    // 添加或修改确定
    onAddNewOk() {
        console.log('AAAAAAAA');
        const me = this;
        const { form } = me.props;
        if (me.state.fileLoading || me.state.fileDetailLoading) {
            message.warning('有图片正在上传...');
            return;
        }

        form.validateFields([
            'addnewName',
            'addnewTypeId',
            'addnewTypeCode',
            'addnewOnShelf',
            'addnewProductImg',
            'addnewDetailImg',
            'addnewTimeLimitType',
            'addnewTimeLimitNum',
            'addnewActivityType'
        ], (err, values) => {
            if (err) { return false; }
            me.setState({
                addnewLoading: true,
            });

            const params = {
                name: values.addnewName,
                typeId: Number(values.addnewTypeId),
                typeCode: Number(values.addnewTypeCode),
                timeLimitType: values.addnewTimeLimitType,
                timeLimitNum: values.addnewTimeLimitNum,
                onShelf: values.addnewOnShelf ? 1 : 0,
                activityType: values.addnewActivityType,
                productImg: this.state.fileList.map((item) => item.url).join(','),
                // detailImg: this.state.fileListDetail.length ? this.state.fileListDetail[0].url : '',
                detailImg: this.state.fileListDetail.map((item) => item.url).join(','),
            };
            if (this.state.addOrUp === 'add') { // 新增
                me.props.actions.addProduct(tools.clearNull(params)).then((res) => {
                    me.setState({
                        addnewLoading: false,
                    });
                    this.onGetData(this.state.pageNum, this.state.pageSize);
                    this.onAddNewClose();
                }).catch(() => {
                    me.setState({
                        addnewLoading: false,
                    });
                });
            } else {
                params.id = this.state.nowData.id;
                me.props.actions.updateProduct(params).then((res) => {
                    me.setState({
                    addnewLoading: false,
                });
                this.onGetData(this.state.pageNum, this.state.pageSize);
                this.onAddNewClose();
            }).catch(() => {
                    me.setState({
                        addnewLoading: false,
                    });
                });
            }

        });
    }

    // 关闭模态框
    onAddNewClose() {
        this.setState({
            addnewModalShow: false,
        });
    }

    // 表单页码改变
    onTablePageChange(page, pageSize) {
        this.onGetData(page, pageSize);
    }
    // 真正从服务端删除商品的图片
    deleteImg(uri) {
        const temp = uri.split('/');
        const fileName = temp.splice(-1,1);
        const params = {
            path: temp.join('/'),
            fileName,
        };
        console.log('删除后的是啥？', temp.join('/'), fileName);
        this.props.actions.deleteImage(params);
    }

    // 产品图片 - 上传中、上传成功、上传失败的回调
    onUpLoadChange(obj) {
        console.log('图片上传：', obj);
        if (obj.file.status === 'done') {
            // 上传成功后调用,将新的地址加进原list
            if (obj.file.response.messsageBody) {
                const list = _.cloneDeep(this.state.fileList);
                const t = list.find((item) => item.uid === obj.file.uid);
                t.url = obj.file.response.messsageBody;
                this.setState({
                    fileList: list,
                    fileLoading: false,
                });
            } else {
                const list = _.cloneDeep(this.state.fileList);
                this.setState({
                    fileList: list.filter((item) => item.uid !== obj.file.uid),
                    fileLoading: false,
                });
                message.error('图片上传失败');
            }
        } else if (obj.file.status === 'uploading') {
            this.setState({
                fileLoading: true,
            });
        } else if(obj.file.status === 'error'){
            const list = _.cloneDeep(this.state.fileList);
            this.setState({
                fileList: list.filter((item) => item.uid !== obj.file.uid),
                fileLoading: false,
            });
            message.error('图片上传失败');
        }
    }

    // 产品图片 - 上传前
    onUploadBefore(f, fl) {
        console.log('上传前：', f, fl);
        if (['jpg', 'jpeg', 'png', 'bmp', 'gif'].indexOf(f.type.split('/')[1]) < 0) {
            message.error('只能上传jpg、jpeg、png、bmp、gif格式的图片');
            return false;
        } else {
            const newList = _.cloneDeep(this.state.fileList);
            newList.push(f);
            this.setState({
                fileList: newList,
            });
            return true;
        }
    }

    // 产品图片 - 删除一个图片
    onUpLoadRemove(f) {
        console.log('删除；', f);
        this.deleteImg(f.url);
        const list = _.cloneDeep(this.state.fileList);
        this.setState({
            fileList: list.filter((item) => item.uid !== f.uid),
        });
    }

    // 详细图片 - 上传前
    onUploadDetailBefore(f) {
        if (['jpg', 'jpeg', 'png', 'bmp', 'gif'].indexOf(f.type.split('/')[1]) < 0) {
            message.error('只能上传jpg、jpeg、png、bmp、gif格式的图片');
            return false;
        } else {
            const newList = _.cloneDeep(this.state.fileListDetail);
            newList.push(f);
            this.setState({
                fileListDetail: newList,
            });
            return true;
        }
    }

    // 详细图片 - 上传中、成功、失败
