                      label="产品名称"
                      {...formItemLayout}
                  >
                      {!!this.state.nowData ? this.state.nowData.name : ''}
                  </FormItem>
                  <FormItem
                      label="产品类型"
                      {...formItemLayout}
                  >
                      {!!this.state.nowData ? this.findProductNameById(this.state.nowData.typeId) : ''}
                  </FormItem>
                    <FormItem
                        label="产品型号"
                        {...formItemLayout}
                    >
                        {!!this.state.nowData ? this.getNameByModelId(this.state.nowData.typeCode) : ''}
                    </FormItem>
                    <FormItem
                        label="活动方式"
                        {...formItemLayout}
                    >
                        {!!this.state.nowData ? this.getActivity(this.state.nowData.activityType) : ''}
                    </FormItem>
                    <FormItem
                        label="价格"
                        {...formItemLayout}
                    >
                        {!!this.state.nowData ? this.state.nowData.price : ''}
                    </FormItem>
                    <FormItem
                        label="有效期"
                        {...formItemLayout}
                        className = {this.state.code == 1 ||this.state.code == 2 || this.state.code == 3 ? 'hide' : ''}
                    >
                        {!!this.state.nowData ? this.getNameForInDate(this.state.nowData.timeLimitNum, this.state.nowData.timeLimitType) : ''}
                    </FormItem>
                    <FormItem
                        label = '运费'
                        {...formItemLayout}
                        className = {this.state.code == 4 ||this.state.code == 5 ? 'hide' : ''}
                    >
                        {!!this.state.nowData ? this.state.nowData.shipFee : ''}
                    </FormItem>
                    <FormItem
                        label = '开户费'
                        {...formItemLayout}
                        className = {this.state.code== 2|| this.state.code== 3 || this.state.code == 4 ||this.state.code == 5 ? 'hide' : ''}
                    >
                        {!!this.state.nowData ? this.state.nowData.openAccountFee : ''}
                    </FormItem>
                    <FormItem
                        label="产品图片"
                        {...formItemLayout}
                    >
                        {(!!this.state.nowData && this.state.nowData.productImg) ? this.state.nowData.productImg.split(',').map((item, index) => {
                            return <Popover key={index} placement="right" content={<img className="table-img-big" src={item} />}><img className="small-img" src={item} /></Popover>
                        }): ''}
                    </FormItem>
                    <FormItem
                        label="详情图片"
                        {...formItemLayout}
                    >
                        {(!!this.state.nowData && this.state.nowData.detailImg) ? this.state.nowData.detailImg.split(',').map((item, index) => {
                            return <Popover key={index} placement="right" content={<img className="table-img-big" src={item} />}><img className="small-img" src={item} /></Popover>
                        }): ''}
                        {/*{(!!this.state.nowData && this.state.nowData.detailImg) ? <Popover placement="right" content={<img className="table-img-big" src={this.state.nowData.detailImg} />}><img className="small-img" src={this.state.nowData.detailImg} /></Popover> : ''}*/}
                    </FormItem>
                    <FormItem
                        label="状态"
                        {...formItemLayout}
                    >
                        {!!this.state.nowData ? (this.state.nowData.onShelf ? '已上架' : '未上架') : ''}
                    </FormItem>
                </Form>
              </Modal>
            </div>
        );
    }
}

